import React from 'react';
import './seeMoreButton.css';

function SeeMoreButton(props) {
  return (
    <div className='see-more__container'>
      <button
        className='see-more__button'
        type='button'
        onClick={props.onClick}
      >
        See More
      </button>
    </div>
  );
}

export default SeeMoreButton;
